pragma solidity >=0.4.16 <0.9.0;

contract CrowdFunding { 
    address private immutable owner; 
    uint256 private nextId = 1; 
    Campaign[] public campaigns; 

    bool private locked; 

    modifier nonReentrant() { 
        require(!locked, "Reentrant call");
        locked = true; 
        _;
        locked = false;
    }

    struct Campaign {
        uint id;
        address campaignCreator;
        string title;
        string description;
        string imageURI;
        uint goal;
        uint startsAt;
        uint endsAt;
        STATUS status;
        uint totalContributions;
        address[] contributors;
        uint[] contributionAmounts;
    }

    enum STATUS { 
        ACTIVE, 
        DELETED, 
        SUCCESSFULL, 
        UNSUCCEEDED
    }

    event CampaginCreated(uint indexed campaignId, address campaignCreator, string title, STATUS status);

    event CampaginDeleted(uint indexed campaignId, address campaignCreator, STATUS status);

    event ContributionMade(uint indexed campaignId, address contributor, uint amount);

    event RefundMade(uint indexed campaignId, address contributor, uint amount);

    constructor() { 
        owner = msg.sender;

        createCampaign(
            "Sneakers Charcoal Lime", 
            "A stylish pair of sneakers in charcoal and lime colors.", 
            "/images/chuks.png", 
            2000 ether, 
            block.timestamp + 10 days
        );

        createCampaign(
            "Hoodie Lime", 
            "A comfortable and trendy lime-colored hoodie.", 
            "/images/greent.png", 
            5000 ether, 
            block.timestamp + 15 days
        );

        createCampaign(
            "Inflatable Puffer Smiley Lime", 
            "A fun and inflatable puffer jacket with a smiley design.", 
            "/images/clothes-2.png", 
            1500 ether, 
            block.timestamp + 8 days
        );

        createCampaign(
            "Sky", 
            "A high-quality sky-themed product.", 
            "/images/pipe.png", 
            15000 ether, 
            block.timestamp + 20 days
        );
    }


    modifier OnlyOwner() { 
        require(msg.sender == owner, "Only the owner can perform this action.");
        _;
    }

    function createCampaign(
        string memory title, 
        string memory description, 
        string memory imageURI, 
        uint goal, 
        uint endsAt
    )  public { 
        require(bytes(title).length > 0, 'Title must not be empty');
        require(bytes(description).length > 0, "Description must not be empty");
        require(bytes(imageURI).length > 0, 'Image URI must not be empty');
        require(goal > 0, 'Goal must be greater than zero');
        require(endsAt > block.timestamp, 'Ends time must be greater than the current time');

        campaigns.push(Campaign(
            nextId++, 
            msg.sender, 
            title, 
            description, 
            imageURI,
            goal,
            block.timestamp,
            endsAt,
            STATUS.ACTIVE,
            0,
            new address[](0),
            new uint[](0)
        ));

        emit CampaginCreated(nextId - 1, msg.sender, title, STATUS.ACTIVE);
    }

    function contribute(uint campaignId) public payable nonReentrant { 
        Campaign storage campaign = campaigns[campaignId];

        require(msg.value > 0, 'Contribution amount must be greater than 0.');

        uint reminingFundsNeeded = campaign.goal - campaign.totalContributions; 

        if(msg.value <= reminingFundsNeeded) { 
            campaign.totalContributions += msg.value;
        } else { 
            uint excessAmount = msg.value - reminingFundsNeeded; 
            uint refundedAmount = msg.value - excessAmount; 
            payable(msg.sender).transfer(excessAmount); 
            campaign.totalContributions += refundedAmount;
            if(campaign.totalContributions >= campaign.goal) { 
                campaign.status = STATUS.SUCCESSFULL;
            }
        }

        campaign.contributors.push(msg.sender);
        campaign.contributionAmounts.push(msg.value);

        emit ContributionMade(campaignId, msg.sender,  msg.value);
    }

    function deleteCampaign(uint campaignId) public{ 
        Campaign storage campaign = campaigns[campaignId];

        require(campaign.campaignCreator == msg.sender);

        refund(campaignId); 

        campaign.status = STATUS.DELETED;

        emit CampaginDeleted(campaignId, msg.sender, STATUS.DELETED);
    }

    function refund(uint campaignId) internal { 
        Campaign storage campaign = campaigns[campaignId]; 
        for(uint i = 0; i < campaign.contributors.length; i++) { 
            address contributor = campaign.contributors[i]; 
            uint contributionAmount = campaign.contributionAmounts[i]; 
            payable(contributor).transfer(contributionAmount);
            campaign.totalContributions -= contributionAmount;
        }
    }    

    function getAllCamapigns() public view returns(Campaign[] memory) { 
        return campaigns;
    }   

    function getCampaignDetails(uint campaignId) public view returns (
                uint id, 
        address campaignCreator,
        string memory title,
        string memory description,
        string memory imageURI,
        uint goal,
        uint startsAt,
        uint endsAt,
        STATUS status,
        uint totalContributions,
        address[] memory contributors,
        uint[] memory contributionAmounts
    ) { 
        Campaign memory campaign = campaigns[campaignId];
        return (
            campaign.id, 
            campaign.campaignCreator, 
            campaign.title,
            campaign.description,
            campaign.imageURI,
            campaign.goal,
            campaign.startsAt,
            campaign.endsAt,
            campaign.status,
            campaign.totalContributions,
            campaign.contributors,
            campaign.contributionAmounts
        );
    }

    function currentTime() public view returns (uint) { 
        return (block.timestamp * 1000) + 1000;
    }

    function getLatestCampaign() public view returns(Campaign[] memory) { 
        require(campaigns.length > 0, "No campaign found.");
        uint startIndex = campaigns.length > 4 ? campaigns.length - 4: 0; 
        uint latestCampaignCount = campaigns.length - startIndex; 

        Campaign[] memory latestCampaigns = new Campaign[](latestCampaignCount); 

        for(uint i = 0; i < latestCampaignCount; i++) { 
            latestCampaigns[i] = campaigns[campaigns.length - 1 - i]; 
        }

        return latestCampaigns;
    }
}

